INSERT INTO `contents` VALUES (1,'¿Qué? / ¿Cómo? / ¿Quienes? ','que-como-quienes','Page','!!@1\r\n##Qué\r\nEstamos desarrollando una **plataforma  web de procesos colectivos de vivienda** que pretende ofrecer herramientas para fomentar  la participación y autogestión en la construcción de nuestras viviendas y entornos.\r\n\r\nPretendemos ofrecer y debatir alternativas al modelo dominante de vivienda actual, proponiendo experiencias construidas y guías de asesoría que nos ayuden a ver otra manera de hacer las cosas.\r\n\r\nQueremos que pueda convertirse en un lugar de encuentro y debate, que cree red y sinergias entre colectivos, professionales y ciudadanía. Un lugar para compartir experiencias, desarrollar conocimiento y acciones de manera colaborativa.\r\n\r\n##Cómo\r\nLlevamos un tiempo trabajando en este proyecto, pero hemos querido comenzar a hacerlo público  con este Blog, no tenemos aun decidido el nombre, pero si tenemos claro que no queremos un nombre demasiado rebuscado que solo tenga sentido para pocas personas, por eso nos gustaría contar con vuestras opiniones y propuestas. \r\n\r\nEn las próximas semanas vamos a ir subiendo entradas al blog sobre diversas temáticas relacionadas con la vivienda participativa, !cualquier comentario es bienvenido!.\r\n\r\nEn Abril se lanzará la web inicial para recopilar información, y a principios de Julio se lanzará la web definitiva, con herramientas concretas de asesoramiento. \r\n\r\n##Quienes\r\nEs un proyecto iniciado por **[lapanaderia](http://www.despachodepan.com)**, desarrollado en colaboración con **[sostrecivic](http://www.sostrecivic.org/)**. El objetivo es que todas las personas y colectivos interesados puedan participar y aportar debate y contenidos a las propuestas que se ofrezcan.\r\n\r\n\r\n\r\n![licencia CC](http://i.creativecommons.org/l/by-nc-sa/2.5/es/80x15.png)\r\n\r\n*video realizado por [daniel alonso](http://www.flickr.com/photos/ponybravo) con material del alan lomax archive*\r\n','markdown','2012-02-15 20:48:59','2012-03-02 11:46:05',NULL,'','2012-02-24','Què? / Com? / Qui? ','!!@1\r\n##Què\r\nEstem desenvolupant una **plataforma  web de processos col·lectius d\'habitatge** que pretén oferir eines per fomentar la participació i l\'autogestió en la construcció dels nostres habitatges i entorns.\r\n\r\nPretenem oferir i debatre alternatives al model dominant d\'habitatge actual, proposant experiències construïdes y guies d\'assessoria que ens ajudin a veure una altra manera de fer les coses.\r\n\r\nVolem que es pugui convertir en un lloc de trobada i debat i creï xarxes i sinèrgies entre col·lectius, professionals i ciutadania. Un lloc per compartir experiències, desenvolupar coneixements i accions de manera col·laborativa.\r\n\r\n##Com\r\nPortem un temps treballant en aquest projecte, però hem volgut començar a fer-ho públic amb aquest Blog, encara no hem decidit el nom, però ja tenim clar que no volem un nom massa rebuscat que només tingui sentit per unes poques persones, per això ens agradaria comptar amb les vostres opinions i propostes. \r\n\r\nA les properes setmanes anirem pujant entrades al blog sobre diverses temàtiques relacionades amb l\'habitatge participatiu, qualsevol comentari és benvingut!. \r\n\r\nA l\'Abril es llançarà el web inicial per recopilar informació, i a principis de Juliol es llençarà el web definitiu, amb eines concretes d\'assessorament. \r\n\r\n##Qui\r\nÉs un projecte iniciat per **[lapanaderia](http://www.despachodepan.com)**, desenvolupat en col·laboració amb **[sostrecivic](http://www.sostrecivic.org/)**. L\'objectiu és que totes les persones i col·lectius interessats puguin participar i aportar debat i continguts a les propostes que s\'ofereixen. \r\n\r\n\r\n\r\n![licencia CC](http://i.creativecommons.org/l/by-nc-sa/2.5/es/80x15.png)\r\n\r\n*vídeo realitzat per [daniel alonso](http://www.flickr.com/photos/ponybravo) amb material de l\'alan lomax archive*'),(2,'¿Qué queremos hacer? (...algunas ideas para elegir nombre...)','que-queremos-hacer-algunas-ideas-para-elegir-nombre','Page','1. Crear una comunidad virtual de práctica y aprendizaje sobre procesos colectivos de producción de vivienda.\r\n\r\n2. Fomentar la participación y autogestión en los procesos de hacer y transformar nuestras viviendas, planteando modelos alternativos de acceso a la vivienda más cooperativos, así como modelos de vivienda adaptables y apropiables por las personas usuarias.\r\n\r\n3. Fomentar la necesidad de compartir recursos y espacios para fomentar otros modos de vida, más sostenibles y viables en nuestros contextos locales.\r\n\r\n4. Fomentar la vivienda como un proceso abierto en el que la ciudadanía participemos más en el mismo, planteando modos de colaboración entre profesionales y personas usuarias, más colaborativos y horizontales.\r\n\r\n5. Elaborar un archivo de experiencias construidas de procesos colectivos y participativos en torno a la vivienda.\r\n\r\n6. Ofrecer herramientas y contenidos teóricos a ciudadanía y profesionales, para fomentar la autogestión y el trabajo colaborativo en los procesos de vivienda.','markdown','2012-02-15 20:48:59','2012-03-02 09:53:07',NULL,'','2012-02-24','Què volem fer? (...algunes idees per escollir nom...)','1. Crear una comunitat virtual de pràctica i aprenentatge en relació a processos col·lectius de producció d\'habitatge.\r\n\r\n2. Fomentar la participació i l\'autogestió en els processos de fer i transformar els nostres habitatges, plantejant models alternatius d\'accés a l\'habitatge més cooperatius, així com models d\'habitatge adaptables i apropiables per les persones usuaries.  \r\n\r\n3. Fomentar la necessitat de compartir recursos i espais per fomentar altres maneres de viure més sostenibles i viables als nostres contextos locals.\r\n\r\n4. Fomentar l\'habitatge com un procés obert on la ciutadania participem més, plantejant mecanismes de col·laboració entre professionals i persones usuàries, més col·laboratius i horitzontals.\r\n\r\n5. Elaborar un arxiu d\'experiències construïdes de processos col·lectius i participatius entorn a l\'habitatge.\r\n\r\n6. Oferir eines i continguts teòrics a ciutadania i professionals per fomentar l\'autogestió i el treball col·laboratiu als processos d\'habitatge. '),(3,'¿por qué este proyecto?','por-que-este-proyecto','Post','...llevamos unos años dándole vuelta a esto... echábamos en falta que existiera en la web un lugar donde pudiéramos encontrar herramientas, experiencias construidas y recursos varios sobre procesos colectivos y participativos de creación de vivienda.\r\n\r\nUn modo de hacer vivienda colectiva **más asequible y accesible**, basado principalmente en el **bien común**. Un modelo de gestión **más cooperativa**, donde se puedan **compartir recursos**.  Espacios donde el diseño sea fruto de un **proceso más colaborativo** entre profesionales y personas usuarias.  Espacios  que nos permitan vivir en casas que se puedan **adaptar** mejor a nuestras necesidades cambiantes, que puedan crecer, **transformarse** y reciclarse. Un modelo que nos permita gestionar y mantener de manera colectiva nuestras casas y plantear **otros modos de vida y uso** de los recursos, más saludables, sostenibles y comunitarios...casi nada ;-) ...Esto implica repensar a partir de la casa, barrios y ciudades en los que queremos vivir.\r\n\r\n!!@8\r\n\r\n**El objetivo del proyecto es crear una web** donde, personas y grupos que estén interesadas en iniciar, promover  y participar en un proyecto colectivo de vivienda, puedan encontrar información y asesoría sobre las opciones alternativas que existen. Así mismo, se ofrece la posibilidad de aportar experiencias construidas que podamos conocer, o colectivos y equipos de profesionales que trabajen sobre estas temáticas.\r\n\r\nEl acceso a la información se pretende organizar en base a posibles **preguntas abiertas** necesarias si quisiéramos resolver nuestra falta de vivienda de manera colectiva. Las preguntas se organizan según los momentos principales del proceso, y nos permitirán tambien organizar las experiencias construidas y los agentes implicados.\r\n\r\n**Etapa de organización y gestión > > >**\r\n¿Quiero/puedo resolver mi problema de vivienda con más gente, de manera colaborativa?\r\n¿Cuándo me puedo implicar? \r\n\r\n**Etapa diseño y construcción> > >**\r\n¿Quiero/puedo participar en la fase de diseño y construcción?\r\n¿Cómo hacemos juntos el proyecto? \r\n\r\n**Etapa de uso y vida útil> > >**\r\n¿Quiero/puedo que mi vivienda se adapte a mis necesidades y cambios vitales? \r\n¿Cómo convivimos y gestionamos colectivamente nuestros espacios y recursos?\r\n\r\n##Funcionalidades iniciales de la plataforma:\r\n1.- Elaborar herramientas y debatir alternativas de modelos colaborativos de producción, diseño y gestión de vivienda colectiva.\r\n\r\n2.- Recopilar y organizar una base de datos de experiencias colectivas de vivienda que ilustren las alternativas propuestas.\r\n\r\n3.- Generar red entre colectivos que permita poner en contacto a nivel local a ciudadanos interesados, con equipos técnicos que trabajen con estos valores y estrategias.\r\n\r\n\r\n*video realizado por [daniel alonso](http://www.flickr.com/photos/ponybravo)*','markdown','2012-02-22 09:23:10','2012-03-02 11:46:24',NULL,'lapanaderia + sostrecivic','2012-02-24','per què aquest projecte?','...portem uns anys donant-li voltes... trobàvem a faltar l\'existència d\'un web on trobar eines, experiències construïdes i recursos diversos en relació a processos col·lectius i participatius de creació d\'habitatge.\r\n\r\nUna manera de fer habitatge col·lectiu **més assequible y accessible**, basat principalment en el **bé comú**. Un model de gestió **més cooperatiu**, on es puguin **compartir recursos**.  Espais on el disseny sigui fruit d\'un **procés més col·laboratiu** entre professionals i persones usuàries.  Espais  que ens permeten viure en cases que es puguin **adaptar** millor a les nostres necessitats canviants, que puguin créixer, **transformar-se** i reciclar-se. Un model que ens permeti gestionar i mantenir de manera col·lectiva les nostres cases i plantejar  **altres maneres de vida i ús** dels recursos, més saludables, sostenibles y comunitaris...quasi res ;-) ...Això implica repensar a partir de la casa, barris i ciutats on volem viure.\r\n\r\n!!@8\r\n\r\n**L\'objectiu del projecte és crear un web** on, persones i grups que estiguin interessats en iniciar, promoure  i participar en un projecte col·lectiu d\'habitatge, puguin trobar informació i assessoria en relació a les opcions alternatives que existeixen. Alhora, s\'ofereix la possibilitat d\'aportar experiències construïdes que puguem conèixer o col·lectius i equips professionals que treballin sobre aquestes temàtiques. \r\n\r\nL\'accés a la informació es pretén organitzar en base a possibles **preguntes obertes** necessàries si volguéssim resoldre la nostra manca d\'habitatge de manera col·lectiva. Les preguntes s\'organitzen segons els moments principals del procés, i ens permetran també organitzar les experiències construïdes i els agents implicats. \r\n\r\n**Etapa d\'organització y gestió > > >**\r\nVull/puc resoldre el meu problema d\'habitatge amb més gent, de manera col·laborativa?\r\nQuan m\'hi puc implicar? \r\n\r\n**Etapa de disseny i construcció> > >**\r\nVull/puc participar a la fase de disseny i construcció?\r\nCom fem junts el projecte? \r\n\r\n**Etapa d\'ús i vida útil> > >**\r\nVull/puc que el meu habitatge s\'adapti a les meves necessitats i canvis vitals? \r\nCom convivim i gestionem col·lectivament els nostres espais i recursos?\r\n\r\n##Funcionalitats inicials de la plataforma:\r\n1.- Elaborar eines i debatre alternatives de models col·laboratius de producció, disseny i gestió d\'habitatges col·lectiu. \r\n\r\n2.- Recopilar i organitzar una base de dades d\'experiències col·lectives d\'habitatge que il·lustrin les alternatives proposades.\r\n\r\n3.- Generar xarxa entre col·lectius que permeti posar en contacte a nivell local la ciutadania interessada amb equips tècnics que treballin amb aquests valors i estratègies. \r\n\r\n\r\n*vídeo realitzat per [daniel alonso](http://www.flickr.com/photos/ponybravo)*'),(4,'créditos','creditos','Page','prueba de página de créditos','markdown','2012-02-24 11:05:55','2012-02-28 11:06:46',NULL,'','2012-02-24',NULL,NULL);
